    return (
        <div className="h-screen px-[18.5%] pt-[22%] md:pt-[8%] bg-cover bg-[#ffffff] bg-fixed pb-[10%]">
            <div className="text-4xl font-bold my-7">Welcome, user!</div>
        </div>
    );
};

export default Dashboard;
